import React from 'react';
import './SubscriptionButton.css';

function SubscriptionButton() {
  const handleClick = () => {
    console.log('Buy subscription clicked');
  };

  return (
    <button className="subscription-button" onClick={handleClick}>
      <svg className="button-icon" width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M10 2L12 8H18L13 11L15 17L10 14L5 17L7 11L2 8H8L10 2Z" fill="white"/>
      </svg>
      <span className="button-text">Купить подписку</span>
      <span className="button-price">от 149 Р</span>
    </button>
  );
}

export default SubscriptionButton;
